import React, {Component} from "react";
import "./TodoElement.css"
class RenderTodoList extends Component{
    render(){
        var renderList = [];
        var renderInput = this.props.dataTodoList;
        console.log(renderInput);
        var i =0;
        while(i<renderInput.length){
            renderList.push(<div className="todoMainElement" key={renderInput[i].todolist}>{renderInput[i].todolist}</div>);
            i=i+1;
        }
        return(
            <div>
                {renderList}
            </div>
        )
    }
}

export default RenderTodoList;
